package main

import "fmt"

type TreeNode struct {
	Val   int
	Left  *TreeNode
	Right *TreeNode
}

func createBinaryTree(descriptions [][]int) *TreeNode {
	treeMap := make(map[int]*TreeNode)
	childNodeMap := make(map[int]*TreeNode)

	// 先创建所有的节点
	for _, description := range descriptions {
		treeMap[description[0]] = &TreeNode{
			Val: description[0],
		}

		treeMap[description[1]] = &TreeNode{
			Val: description[1],
		}

		// 将子节点单独放入一个map, 这样不在childNodeMap中的就得根节点
		childNodeMap[description[1]] = &TreeNode{
			Val: description[1],
		}
	}

	root := &TreeNode{}
	for _, description := range descriptions {
		// 找到根节点
		if _, ok := childNodeMap[description[0]]; !ok {
			root = treeMap[description[0]]
		}

		// 组装每一个子数
		parent := treeMap[description[0]]
		if description[2] == 1 {
			parent.Left = treeMap[description[1]]
		} else {
			parent.Right = treeMap[description[1]]
		}
	}

	return root
}

